INSERT INTO `hasil_analisa` VALUES (1, 'Kamal', '{\"gejala\":[{\"id\":3,\"kode_gejala\":\"G3\",\"nama_gejala\":\"Rasa panas pada anus setelah BAB\",\"nilai\":0.5,\"created_at\":\"2022-07-01T05:12:51.000000Z\",\"updated_at\":\"2022-07-01T05:12:51.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.4\",\"CF\":0.2},{\"id\":4,\"kode_gejala\":\"G4\",\"nama_gejala\":\"Rasa mengganjal setelah BAB\",\"nilai\":0.7,\"created_at\":\"2022-07-01T05:12:51.000000Z\",\"updated_at\":\"2022-07-01T05:12:51.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.4\",\"CF\":0.27999999999999997},{\"id\":6,\"kode_gejala\":\"G6\",\"nama_gejala\":\"Nyeri saat BAB\",\"nilai\":0.7,\"created_at\":\"2022-07-01T05:12:54.000000Z\",\"updated_at\":\"2022-07-01T05:12:54.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.6\",\"CF\":0.42},{\"id\":10,\"kode_gejala\":\"G10\",\"nama_gejala\":\"Benjolan dapat masuk dengan bantuan dorongan jari\",\"nilai\":0.7,\"created_at\":\"2022-07-01T05:12:57.000000Z\",\"updated_at\":\"2022-07-01T05:12:57.000000Z\",\"deleted_at\":null,\"nilai_user\":\"1\",\"CF\":0.7}],\"penyakit\":{\"1\":{\"kode_penyakit\":\"P1\",\"nama_penyakit\":\"Wasir 1\",\"penyebab\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[3,4,6],\"cfold_rumus\":[{\"c1\":0.2,\"c2\":0.27999999999999997},{\"c1\":0.384,\"c2\":0.42}],\"list_cfold\":[0.384,0.5788800000000001],\"hasil_cf_penyakit\":\"28\"},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[3,4,6],\"cfold_rumus\":[{\"c1\":0.2,\"c2\":0.27999999999999997},{\"c1\":0.384,\"c2\":0.42}],\"list_cfold\":[0.384,0.5788800000000001],\"hasil_cf_penyakit\":\"28\"},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[3,4,6,10],\"cfold_rumus\":[{\"c1\":0.2,\"c2\":0.27999999999999997},{\"c1\":0.384,\"c2\":0.42},{\"c1\":0.5788800000000001,\"c2\":0.7}],\"list_cfold\":[0.384,0.5788800000000001,0.7417504000000001],\"hasil_cf_penyakit\":\"31\"},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[3,4,6],\"cfold_rumus\":[{\"c1\":0.2,\"c2\":0.27999999999999997},{\"c1\":0.384,\"c2\":0.42}],\"list_cfold\":[0.384,0.5788800000000001],\"hasil_cf_penyakit\":\"28\"}}}', '2022-07-01 09:17:07', '2022-07-01 09:17:07', NULL);
