INSERT INTO `hasil_analisa` VALUES (7, 'Bambang', '{\"gejala\":[{\"id\":1,\"kode_gejala\":\"G01\",\"nama_gejala\":\"Sulit BAB\",\"nilai\":0.8000000000000000444089209850062616169452667236328125,\"created_at\":\"2022-07-05T23:27:24.000000Z\",\"updated_at\":\"2022-07-06T03:27:24.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.8\",\"CF\":0.640000000000000124344978758017532527446746826171875},{\"id\":5,\"kode_gejala\":\"G05\",\"nama_gejala\":\"Bercak darah pada feses\",\"nilai\":0.6999999999999999555910790149937383830547332763671875,\"created_at\":\"2022-07-05T23:27:49.000000Z\",\"updated_at\":\"2022-07-06T03:27:49.000000Z\",\"deleted_at\":null,\"nilai_user\":\"1\",\"CF\":0.6999999999999999555910790149937383830547332763671875},{\"id\":6,\"kode_gejala\":\"G06\",\"nama_gejala\":\"Nyeri saat BAB\",\"nilai\":0.6999999999999999555910790149937383830547332763671875,\"created_at\":\"2022-07-05T23:27:55.000000Z\",\"updated_at\":\"2022-07-06T03:27:55.000000Z\",\"deleted_at\":null,\"nilai_user\":\"1\",\"CF\":0.6999999999999999555910790149937383830547332763671875}],\"penyakit\":{\"1\":{\"kode_penyakit\":\"P1\",\"nama_penyakit\":\"Wasir 1\",\"penyebab\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,5,6],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.6999999999999999555910790149937383830547332763671875},{\"c1\":0.482399999999999884447987597013707272708415985107421875,\"c2\":0.6999999999999999555910790149937383830547332763671875}],\"list_cfold\":[0.482399999999999884447987597013707272708415985107421875,0.35472000000000003527844683048897422850131988525390625],\"hasil_cf_penyakit\":\"24\"},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,5,6],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.6999999999999999555910790149937383830547332763671875},{\"c1\":0.482399999999999884447987597013707272708415985107421875,\"c2\":0.6999999999999999555910790149937383830547332763671875}],\"list_cfold\":[0.482399999999999884447987597013707272708415985107421875,0.35472000000000003527844683048897422850131988525390625],\"hasil_cf_penyakit\":\"24\"},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,5,6],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.6999999999999999555910790149937383830547332763671875},{\"c1\":0.482399999999999884447987597013707272708415985107421875,\"c2\":0.6999999999999999555910790149937383830547332763671875}],\"list_cfold\":[0.482399999999999884447987597013707272708415985107421875,0.35472000000000003527844683048897422850131988525390625