b\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,7],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.5},{\"c1\":0.4103999999999998760102926098625175654888153076171875,\"c2\":0.5},{\"c1\":0.45519999999999993800514630493125878274440765380859375,\"c2\":0.8000000000000000444089209850062616169452667236328125}],\"list_cfold\":[0.4103999999999998760102926098625175654888153076171875,0.45519999999999993800514630493125878274440765380859375,0.6275999999999999356958824137109331786632537841796875],\"hasil_cf_penyakit\":\"29\"},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,7,8],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.5},{\"c1\":0.4103999999999998760102926098625175654888153076171875,\"c2\":0.5},{\"c1\":0.45519999999999993800514630493125878274440765380859375,\"c2\":0.8000000000000000444089209850062616169452667236328125},{\"c1\":0.6275999999999999356958824137109331786632537841796875,\"c2\":0.59999999999999997779553950749686919152736663818359375}],\"list_cfold\":[0.4103999999999998760102926098625175654888153076171875,0.45519999999999993800514630493125878274440765380859375,0.6275999999999999356958824137109331786632537841796875,0.245519999999999904982672660480602644383907318115234375],\"hasil_cf_penyakit\":\"22\"},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,7,8,10],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.5},{\"c1\":0.4103999999999998760102926098625175654888153076171875,\"c2\":0.5},{\"c1\":0.45519999999999993800514630493125878274440765380859375,\"c2\":0.8000000000000000444089209850062616169452667236328125},{\"c1\":0.6275999999999999356958824137109331786632537841796875,\"c2\":0.59999999999999997779553950749686919152736663818359375},{\"c1\":0.245519999999999904982672660480602644383907318115234375,\"c2\":0.55999999999999994226840271949185989797115325927734375}],\"list_cfold\":[0.4103999999999998760102926098625175654888153076171875,0.45519999999999993800514630493125878274440765380859375,0.6275999999999999356958824137109331786632537841796875,0.245519999999999904982672660480602644383907318115234375,0.32220799999999993890043015198898501694202423095703125],\"hasil_cf_penyakit\":\"24\"},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah