ist_cfold\":[0.374399999999999899547020731915836222469806671142578125,0.52463999999999988421706120789167471230030059814453125,0.5423199999999999132427319636917673051357269287109375,0.423420799999999986074072921837796457111835479736328125,0.57038406400000007945294555611326359212398529052734375,0.5325689881600002006933891607332043349742889404296875],\"hasil_cf_penyakit\":\"27\"},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.40000000000000002220446049250313080847263336181640625},{\"c1\":0.374399999999999899547020731915836222469806671142578125,\"c2\":0.5},{\"c1\":0.52463999999999988421706120789167471230030059814453125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.5423199999999999132427319636917673051357269287109375,\"c2\":0.419999999999999984456877655247808434069156646728515625},{\"c1\":0.423420799999999986074072921837796457111835479736328125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.57038406400000007945294555611326359212398529052734375,\"c2\":0.640000000000000124344978758017532527446746826171875},{\"c1\":0.5325689881600002006933891607332043349742889404296875,\"c2\":0.59999999999999997779553950749686919152736663818359375}],\"list_cfold\":[0.374399999999999899547020731915836222469806671142578125,0.52463999999999988421706120789167471230030059814453125,0.5423199999999999132427319636917673051357269287109375,0.423420799999999986074072921837796457111835479736328125,0.57038406400000007945294555611326359212398529052734375,0.5325689881600002006933891607332043349742889404296875,0.40772483573759987773854618353652767837047576904296875],\"hasil_cf_penyakit\":\"25\"},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.40000000000000002220446049250313080847263336181640625},{\"c1\":0.374399999999999899547020731915836222469806671142578125,\"c2\":0.5},{\"c1\":0.52463999999999988421706120789167471230030059814453125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.5423199999999999132427319636917673051357269287109375,\"c2\":0.419999999999999984456877655247808434069156646728515625},{\"c1\":0.423420799999999986074072921837796457111835479736328125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.57038406400000007945294555611326359212398529052734375,\"c2\":0.640000000000000124344978758017532527446746826171875},{\"c1\":0.5325689881600002006933891607332043349742889404296875,\"c2\":0.59999999999999997779553950749686919152736663818359375}],\"list_cfold\":[0.374399999999999899547020731915836222469806671142578125,0.52463999999999988421706120789167471230030059814453125,0.5423199999999999132427319636917673051357269287109375,0.423420799999999986074072921837796457111835479736328125,0.57038406400000007945294555611326359212398529052734375,0.5325689881600002006933891607332043349742889404296875,0.40772483573759987773854618353652767837047576904296875],\"hasil_cf_penyakit\":\"25\"},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.640000000000000124344978758017532527446746826171875,\"c2\":0.40000000000000002220446049250313080847263336181640625},{\"c1\":0.374399999999999899547020731915836222469806671142578125,\"c2\":0.5},{\"c1\":0.52463999999999988421706120789167471230030059814453125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.5423199999999999132427319636917673051357269287109375,\"c2\":0.419999999999999984456877655247808434069156646728515625},{\"c1\":0.423420799999999986074072921837796457111835479736328125,\"c2\":0.55999999999999994226840271949185989797115325927734375},{\"c1\":0.57038406400000007945294555611326359212398529052734375,\"c2\":0.640000000000000124344978758017532527446746826171875},{\"c1\":0.5325689881600002006933891607332043349742889404296875,\"c2\":0.59999999999999997779553950749686919152736663818359375}],\"list_cfold\":[0.374399999999999899547020731915836222469806671142578125,0.52463999999999988421706120789167471230030059814453125,0.5423199999999999132427319636917673051357269287109375,0.423420799999999986074072921837796457111835479736328125,0.57038406400000007945294555611326359212398529052734375,0.5325689881600002006933891607332043349742889404296875,0.40772483573759987773854618353652767837047576904296875],\"hasil_cf_penyakit\":\"25\"}}}', '2022-07-07 02:01:12', '2022-07-07 02:01:12', NULL);
