n berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.2},{\"c1\":0.35359999999999997,\"c2\":0.3},{\"c1\":0.52288,\"c2\":0.42},{\"c1\":0.6600159999999999,\"c2\":0.27999999999999997},{\"c1\":0.54520928,\"c2\":0.42},{\"c1\":0.6949506816000001,\"c2\":0.6400000000000001}],\"list_cfold\":[0.35359999999999997,0.52288,0.6600159999999999,0.54520928,0.6949506816000001,0.7742713953280002],\"hasil_cf_penyakit\":\"32\"},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.2},{\"c1\":0.35359999999999997,\"c2\":0.3},{\"c1\":0.52288,\"c2\":0.42},{\"c1\":0.6600159999999999,\"c2\":0.27999999999999997},{\"c1\":0.54520928,\"c2\":0.42},{\"c1\":0.6949506816000001,\"c2\":0.6400000000000001}],\"list_cfold\":[0.35359999999999997,0.52288,0.6600159999999999,0.54520928,0.6949506816000001,0.7742713953280002],\"hasil_cf_penyakit\":\"32\"},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.2},{\"c1\":0.35359999999999997,\"c2\":0.3},{\"c1\":0.52288,\"c2\":0.42},{\"c1\":0.6600159999999999,\"c2\":0.27999999999999997},{\"c1\":0.54520928,\"c2\":0.42},{\"c1\":0.6949506816000001,\"c2\":0.6400000000000001}],\"list_cfold\":[0.35359999999999997,0.52288,0.6600159999999999,0.54520928,0.6949506816000001,0.7742713953280002],\"hasil_cf_penyakit\":\"32\"},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.2},{\"c1\":0.35359999999999997,\"c2\":0.3},{\"c1\":0.52288,\"c2\":0.42},{\"c1\":0.6600159999999999,\"c2\":0.27999999999999997},{\"c1\":0.54520928,\"c2\":0.42},{\"c1\":0.6949506816000001,\"c2\":0.6400000000000001}],\"list_cfold\":[0.35359999999999997,0.52288,0.6600159999999999,0.54520928,0.6949506816000001,0.7742713953280002],\"hasil_cf_penyakit\":\"32\"}}}', '2022-07-07 03:00:35', '2022-07-07 03:00:35', NULL);
