er\":\"0.4\",\"CF\":0.24},{\"id\":10,\"kode_gejala\":\"G10\",\"nama_gejala\":\"Benjolan dapat masuk dengan bantuan dorongan jari\",\"nilai\":0.7,\"created_at\":\"2022-07-01T05:12:57.000000Z\",\"updated_at\":\"2022-07-01T05:12:57.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.8\",\"CF\":0.5599999999999999}],\"penyakit\":{\"1\":{\"kode_penyakit\":\"P1\",\"nama_penyakit\":\"Wasir 1\",\"penyebab\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912],\"hasil_cf_penyakit\":67.9067430912},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424],\"hasil_cf_penyakit\":47.791506407424},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8,10],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24},{\"c1\":0.47791506407424,\"c2\":0.5599999999999999}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424,0.7888154486964225],\"hasil_cf_penyakit\":78.88154486964225},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424],\"hasil_cf_penyakit\":47.791506407424}}}', '2022-07-07 03:33:02', '2022-07-07 03:33:02', NULL);
