60000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424],\"hasil_cf_penyakit\":47.791506407424},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424],\"hasil_cf_penyakit\":47.791506407424},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.4},{\"c1\":0.5751200000000001,\"c2\":0.27999999999999997},{\"c1\":0.5130720000000001,\"c2\":0.5599999999999999},{\"c1\":0.7726118399999999,\"c2\":0.27999999999999997},{\"c1\":0.46314920960000006,\"c2\":0.48},{\"c1\":0.679067430912,\"c2\":0.24}],\"list_cfold\":[0.42160000000000003,0.5751200000000001,0.5130720000000001,0.7726118399999999,0.46314920960000006,0.679067430912,0.47791506407424],\"hasil_cf_penyakit\":47.791506407424}}}', '2022-07-07 03:36:58', '2022-07-07 03:36:58', NULL);
