{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.4},{\"c1\":0.804,\"c2\":0.27999999999999997},{\"c1\":0.972,\"c2\":0.5599999999999999},{\"c1\":1.3752,\"c2\":0.27999999999999997},{\"c1\":1.4984,\"c2\":0.48},{\"c1\":1.8439999999999999,\"c2\":0.24}],\"list_cfold\":[0.524,0.804,0.972,1.3752,1.4984,1.8439999999999999,1.9687999999999999],\"hasil_cf_penyakit\":196.88},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.4},{\"c1\":0.804,\"c2\":0.27999999999999997},{\"c1\":0.972,\"c2\":0.5599999999999999},{\"c1\":1.3752,\"c2\":0.27999999999999997},{\"c1\":1.4984,\"c2\":0.48},{\"c1\":1.8439999999999999,\"c2\":0.24}],\"list_cfold\":[0.524,0.804,0.972,1.3752,1.4984,1.8439999999999999,1.9687999999999999],\"hasil_cf_penyakit\":196.88}}}', '2022-07-07 03:41:29', '2022-07-07 03:41:29', NULL);
