null,\"nilai_user\":\"0.8\",\"CF\":0.48},{\"id\":10,\"kode_gejala\":\"G10\",\"nama_gejala\":\"Benjolan dapat masuk dengan bantuan dorongan jari\",\"nilai\":0.7,\"created_at\":\"2022-07-01T05:12:57.000000Z\",\"updated_at\":\"2022-07-01T05:12:57.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.8\",\"CF\":0.5599999999999999}],\"penyakit\":{\"1\":{\"kode_penyakit\":\"P1\",\"nama_penyakit\":\"Wasir 1\",\"penyebab\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.2},{\"c1\":0.6192,\"c2\":0.27999999999999997},{\"c1\":0.725824,\"c2\":0.27999999999999997},{\"c1\":0.80259328,\"c2\":0.27999999999999997},{\"c1\":0.8578671616,\"c2\":0.6400000000000001}],\"list_cfold\":[0.524,0.6192,0.725824,0.80259328,0.8578671616,0.9488321781760001],\"hasil_cf_penyakit\":94.88321781760001},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.2},{\"c1\":0.6192,\"c2\":0.27999999999999997},{\"c1\":0.725824,\"c2\":0.27999999999999997},{\"c1\":0.80259328,\"c2\":0.27999999999999997},{\"c1\":0.8578671616,\"c2\":0.6400000000000001},{\"c1\":0.9488321781760001,\"c2\":0.48}],\"list_cfold\":[0.524,0.6192,0.725824,0.80259328,0.8578671616,0.9488321781760001,0.97339273265152],\"hasil_cf_penyakit\":97.339273265152},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8,10],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.2},{\"c1\":0.6192,\"c2\":0.27999999999999997},{\"c1\":0.725824,\"c2\":0.27999999999999997},{\"c1\":0.80259328,\"c2\":0.27999999999999997},{\"c1\":0.8578671616,\"c2\":0.6400000000000001},{\"c1\":0.9488321781760001,\"c2\":0.48},{\"c1\":0.97339273265152,\"c2\":0.5599999999999999}],\"list_cfold\":[0.524,0.6192,0.725824,0.80259328,0.8578671616,0.9488321781760001,0.97339273265152,0.9882928023666688],\"hasil_cf_penyakit\":98.82928023666689},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.524,\"c2\":0.2},{\"c1\":0.6192,\"c2\":0.27999999999999997},{\"c1\":0.725824,\"c2\":0.27999999999999997},{\"c1\":0.80259328,\"c2\":0.27999999999999997},{\"c1\":0.8578671616,\"c2\":0.6400000000000001},{\"c1\":0.9488321781760001,\"c2\":0.48}],\"list_cfold\":[0.524,0.6192,0.725824,0.80259328,0.8578671616,0.9488321781760001,0.97339273265152],\"hasil_cf_penyakit\":97.339273265152}}}', '2022-07-07 03:47:48', '2022-07-07 03:47:48', NULL);
