us\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.2},{\"c1\":0.43512,\"c2\":0.27999999999999997},{\"c1\":0.572096,\"c2\":0.27999999999999997},{\"c1\":0.6135091199999999,\"c2\":0.27999999999999997},{\"c1\":0.6433265663999999,\"c2\":0.6400000000000001},{\"c1\":0.923995127808,\"c2\":0.48}],\"list_cfold\":[0.42160000000000003,0.43512,0.572096,0.6135091199999999,0.6433265663999999,0.923995127808,0.5054382460108797],\"hasil_cf_penyakit\":50.54382460108797},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8,10],\"cfold_rumus\":[{\"c1\":0.32000000000000006,\"c2\":0.3},{\"c1\":0.42160000000000003,\"c2\":0.2},{\"c1\":0.43512,\"c2\":0.27999999999999997},{\"c1\":0.572096,\"c2\":0.27999999999999997},{\"c1\":0.6135091199999999,\"c2\":0.27999999999999997},{\"c1\":0.6433265663999999,\"c2\":0.6400000000000001},{\"c1\":0.923995127808,\"c2\":0.48},{\"c1\":0.5054382460108797,\"c2\":0.5599999999999999}],\"list_cfold\":[0.42160000000000003,0.43512,0.572096,0.6135091199999999,0.6433265663999999,0.923995127808,0.5054382460108797,0.5540278879256574],\"hasil_cf_penyakit\":55.40278879256574},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu 