8],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.3743999999999999,\"c2\":0.4},{\"c1\":0.46463999999999994,\"c2\":0.5599999999999999},{\"c1\":0.6147839999999999,\"c2\":0.5599999999999999},{\"c1\":0.51690496,\"c2\":0.5599999999999999},{\"c1\":0.4738381824,\"c2\":0.6400000000000001},{\"c1\":0.4900888002560001,\"c2\":0.48}],\"list_cfold\":[0.3743999999999999,0.46463999999999994,0.6147839999999999,0.51690496,0.4738381824,0.4900888002560001,0.3492319680921599],\"hasil_cf_penyakit\":34.92319680921599},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8,10],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.3743999999999999,\"c2\":0.4},{\"c1\":0.46463999999999994,\"c2\":0.5599999999999999},{\"c1\":0.6147839999999999,\"c2\":0.5599999999999999},{\"c1\":0.51690496,\"c2\":0.5599999999999999},{\"c1\":0.4738381824,\"c2\":0.6400000000000001},{\"c1\":0.4900888002560001,\"c2\":0.48},{\"c1\":0.3492319680921599,\"c2\":0.5599999999999999}],\"list_cfold\":[0.3743999999999999,0.46463999999999994,0.6147839999999999,0.51690496,0.4738381824,0.4900888002560001,0.3492319680921599,0.47280062340792317],\"hasil_cf_penyakit\":47.28006234079232},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.3743999999999999,\"c2\":0.4},{\"c1\":0.46463999999999994,\"c2\":0.5599999999999999},{\"c1\":0.6147839999999999,\"c2\":0.5599999999999999},{\"c1\":0.51690496,\"c2\":0.5599999999999999},{\"c1\":0.4738381824,\"c2\":0.6400000000000001},{\"c1\":0.4900888002560001,\"c2\":0.48}],\"list_cfold\":[0.3743999999999999,0.46463999999999994,0.6147839999999999,0.51690496,0.4738381824,0.4900888002560001,0.3492319680921599],\"hasil_cf_penyakit\":34.92319680921599}}}', '2022-07-07 03:52:12', '2022-07-07 03:52:12', NULL);
