704000000000001,0.942976,0.97490944,0.9889601536,0.996025655296,0.9979333407539199],\"hasil_cf_penyakit\":99.793334075392},\"3\":{\"kode_penyakit\":\"P3\",\"nama_penyakit\":\"Wasir 3\",\"penyebab\":\"Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.\",\"solusi\":\"Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.784,\"c2\":0.4},{\"c1\":0.8704000000000001,\"c2\":0.5599999999999999},{\"c1\":0.942976,\"c2\":0.5599999999999999},{\"c1\":0.97490944,\"c2\":0.5599999999999999},{\"c1\":0.9889601536,\"c2\":0.6400000000000001},{\"c1\":0.996025655296,\"c2\":0.48}],\"list_cfold\":[0.784,0.8704000000000001,0.942976,0.97490944,0.9889601536,0.996025655296,0.9979333407539199],\"hasil_cf_penyakit\":99.793334075392},\"4\":{\"kode_penyakit\":\"P4\",\"nama_penyakit\":\"Wasir 4\",\"penyebab\":\"Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.784,\"c2\":0.4},{\"c1\":0.8704000000000001,\"c2\":0.5599999999999999},{\"c1\":0.942976,\"c2\":0.5599999999999999},{\"c1\":0.97490944,\"c2\":0.5599999999999999},{\"c1\":0.9889601536,\"c2\":0.6400000000000001},{\"c1\":0.996025655296,\"c2\":0.48}],\"list_cfold\":[0.784,0.8704000000000001,0.942976,0.97490944,0.98