,\"nilai_user\":\"0.8\",\"CF\":0.48},{\"id\":9,\"kode_gejala\":\"G09\",\"nama_gejala\":\"Benjolan dapat masuk kembali ke anus dengan spontan \\/ tanpa bantuan jari\",\"nilai\":0.5,\"created_at\":\"2022-07-05T23:28:14.000000Z\",\"updated_at\":\"2022-07-06T03:28:14.000000Z\",\"deleted_at\":null,\"nilai_user\":\"0.8\",\"CF\":0.4}],\"penyakit\":{\"1\":{\"kode_penyakit\":\"P1\",\"nama_penyakit\":\"Wasir 1\",\"penyebab\":\"Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7],\"cfold_rumus\":[{\"c1\":0.6400000000000001,\"c2\":0.4},{\"c1\":0.784,\"c2\":0.4},{\"c1\":0.8704000000000001,\"c2\":0.5599999999999999},{\"c1\":0.942976,\"c2\":0.5599999999999999},{\"c1\":0.97490944,\"c2\":0.5599999999999999},{\"c1\":0.9889601536,\"c2\":0.6400000000000001}],\"list_cfold\":[0.784,0.8704000000000001,0.942976,0.97490944,0.9889601536,0.996025655296],\"hasil_cf_penyakit\":99.6025655296},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8,9],\"cfold_rumus\":[{\"c1\":0.640000000000000