400000046920240492909215390682220458984375,\"c2\":0.3200000000000000621724893790087662637233734130859375}],\"list_cfold\":[0.52400000000000002131628207280300557613372802734375,0.6668000000000000593303184359683655202388763427734375,0.80674400000000001664801629885914735496044158935546875,0.8608556800000000119865717351785860955715179443359375,0.919296294400000046920240492909215390682220458984375,0.9451214801920000407875477321795187890529632568359375],\"hasil_cf_penyakit\":94.512148019199997861505835317075252532958984375},\"2\":{\"kode_penyakit\":\"P2\",\"nama_penyakit\":\"Wasir 2\",\"penyebab\":\"Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.\",\"solusi\":\"Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.\",\"gejala\":[1,2,3,4,5,6,7,8],\"cfold_rumus\":[{\"c1\":0.3200000000000000621724893790087662637233734130859375,\"c2\":0.299999999999999988897769753748434595763683319091796875},{\"c1\":0.52400000000000002131628207280300557613372802734375,\"c2\":0.299999999999999988897769753748434595763683319091796875},{\"c1\":0.6668000000000000593303184359683655202388763427734375,\"c2\":0.419999999999999984456877655247808434069156646728515625},{\"c1\":0.80674400000000001664801629885914735496044158935546875,\"c2\":0.279999999999999971134201359745929948985576629638671875},{\"c1\":0.8608556800000000119865717351785860955715179443359375,\"c2\":0.419999999999999984456877655247808434069156646728515625},{\"c1\":0.919296294400000046920240492909215390682220458984375,\"c2\":0.3200000000000000621724893790087662637233734130859375},{\"c1\":0.9451214801920000407875477321795187890529632568359375,\"c2\":0.359999999999999986677323704498121514