INSERT INTO `penyakit` VALUES (1, 'P1', 'Wasir 1', 'Wasir internal biasanya terbentuk di dalam rektum dan di atas garis pektinat, yaitu batas yang membagi dua per tiga saluran anus bagian atas dan bawah. Jenis ambeien ini biasanya ringan dan dapat sembuh dengan sendirinya.', 'Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.', '2022-07-01 05:14:22', '2022-07-01 05:14:22', NULL);
INSERT INTO `penyakit` VALUES (2, 'P2', 'Wasir 2', 'Wasir luar terbentuk di bawah permukaan kulit di sekitar anus. Awalnya, jenis ambeien ini tidak terlihat. Namun, semakin lama pembengkakan akan menyebabkan benjolan berwarna keunguan.', 'Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.', '2022-07-01 05:14:22', '2022-07-01 05:14:22', NULL);
INSERT INTO `penyakit` VALUES (3, 'P3', 'Wasir 3', 'Wasir internal yang semakin parah atau terjadi secara berulang bisa berkembang menjadi wasir prolapse. Benjolan pada wasir ini sudah keluar dari anus dan benjolannya tidak bisa dikembalikan dengan pendorongan oleh tangan.', 'Pada beberapa kasus, orang dengan kondisi ini perlu menjalani operasi untuk mengangkat ambeien supaya tidak menyebabkan komplikasi.', '2022-07-01 05:14:23', '2022-07-01 05:14:23', NULL);
INSERT INTO `penyakit` VALUES (4, 'P4', 'Wasir 4', 'Jenis wasir ini merupakan komplikasi dari wasir, ketika gumpalan darah terbentuk pada benjolan. Kondisi ini dapat terjadi pada wasir internal dan juga eksternal.', 'Untuk menghindari terjadinya wasir, langkah yang dapat dilakukan adalah dengan mengonsumsi makanan kaya serat, banyak minum air putih, dan rutin berolahraga. Selain itu, hindari kebiasaan yang dapat memicu wasir, seperti duduk terlalu lama, menunda BAB, atau mengejan berlebihan.', '2022-07-01 05:14:27', '2022-07-01 05:14:27', NULL);

